import React from 'react';

const Error = () => {
    return (
        <div className='content-wrapper'>
            <div className='card'>
                <div className='card-body'>
                    <div class="text-center pt-4">

                        <p>
                            Oops! Page Not Found
                        </p>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Error;
